import './App.css';

import React, { Component } from 'react'
import Navbar from './contaner/Navbar';
import News from './contaner/News';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

export class App extends Component {
  render() {
    return (
      <div>

       <Navbar/> 

       <BrowserRouter>
       <Routes>
        <Route path='' element={<News sizeofpage={5} country="us" category='health'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='business'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='entertainment'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='general'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='health'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='science'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='sports'/>}/>
        <Route path='' element={<News sizeofpage={5} country="us" category='technology'/>}/>
       </Routes>
       </BrowserRouter>












      </div>
    )
  }
}

export default App
